FeedPackage.Description:
At under 5K minified & gzipped
HeadJS provides you with:
* Asset Loader Load assets when you need them. head.load("somefile1.js", "somefile2.css", function() { done(); })
* JavaScript Organizer Defer execution of functions to the bottom of the page. head.ready(function() { imReady(); })
* Responsive Design Detect and react to resolutions with simple css classes or js tests that work without media query support. .landscape, .lt-800, .gt-1680, if (head.mobile) { }
* Browser Detection Detect browsers & versions, and apply css or js logic to them. .gt-ie6, .lt-ie10, if (head.browser.ios) { }
* Feature Detection Detect browser features like cssreflections, touch-enabled .no-cssreflections, .no-touch if (!head.touch) { }
* CSS Moderniser Detect css support like box-shadow, border-radius .no-borderradius, if (!head.borderradius) { }
* CSS Router Detect page and section someone is on and target it with specific css. .index-page, .register-page, .root-section, .user-section,
* HTML5 Enabler Need to support the new HTML5 tags in older browsers ? No problem !
* And more ..well, a little bit :-)

